import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Button,
  Row,
  Container,
  FormGroup,
  Input,
  Form,
  Card,
  CardHeader
} from "reactstrap";
import { Typography } from "@material-ui/core";
import "../App.css";
import Header from "../header/header";

class Profile extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Container>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <h1 style={{ textAlign: "left" }}>Profile</h1>
          <Row>
            <Col>
              <h1 style={{ textAlign: "left" }}>Anon</h1>
              <h3> 13-10-1990</h3>
              <h3>081200001111</h3>
              <h3>anon@gmail.com</h3>
            </Col>
            <Col></Col>
            <Col></Col>
          </Row>
          <br></br>
          <br></br>
          <h1>Favorites</h1>
        </Container>
      </div>
    );
  }
}

export default Profile;
